// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BShiksha {
    mapping(address => User) public users;
    mapping(address => uint256[]) public walletIdToPostId;

    struct User {
        string userName;
        string userEmail;
        bool isProfessor;
        string universityName;
        address payable walletId;
    }

    uint256 public PostCount = 0;
    mapping(uint256 => Post) public Posts;

    struct Post {
        uint256 id;
        string postCid;
        uint256 tipAmount;
        uint256 viewCost;
        address payable author;
    }

    event UserSignedUp(
        string userName,
        string userEmail,
        bool isProfessor,
        string universityName,
        address payable walletId
    );

    event PostCreated(
        uint256 id,
        string postCid,
        uint256 tipAmount,
        uint256 viewCost,
        address payable author
    );

    event PostTipped(
        uint256 id,
        string postCid,
        uint256 tipAmount,
        uint256 viewCost,
        address payable author
    );

    event PostViewed(
        uint256 id,
        string postCid,
        uint256 tipAmount,
        uint256 viewCost,
        address payable author
    );

    event CommentAdded(
        uint256 postId,
        string commentCid,
        address commenter
    );

    function uploadPost(
        string memory _postCid,
        uint256 _viewCost
    ) public payable {
        require(bytes(_postCid).length > 0, "Post hash is required");
        require(_viewCost >= 0 && _viewCost <= 50 * 1e18, "Set Value 0-50 ETH");

        PostCount++;
        uint256 postId = PostCount;

        Posts[postId] = Post(
            postId,
            _postCid,
            0,
            _viewCost,
            payable(msg.sender)
        );

        walletIdToPostId[msg.sender].push(postId);

        emit PostCreated(postId, _postCid, 0, _viewCost, payable(msg.sender));
    }

